	console.log('props.data', props.data);

	const EvelynProjects = props.data.map((item) => item.project); //to only get the names of the projects
	console.log('EvelynProjects', EvelynProjects);

	// const uniqueprojectNames = projectNames.filter((name, index, names) => {
	// 	// Om dubbele namen er uit te filteren
	// 	return names.indexOf(name) === index;
	// });

	return (
		<VictoryChart theme={VictoryTheme.material} domainPadding={20}>
			<VictoryGroup>
				<VictoryBar />
				<VictoryBar />
			</VictoryGroup>
		</VictoryChart>
	);
};

export default EvelynGraph;
